import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a className="App-link" href="https://dplinktest.netlify.app/">
          Deep link to Home Page
        </a>
        <h1></h1>
        <a className="App-link" href="https://dplinktest.netlify.app/details">
          Deep link to Detail Page
        </a>
      </header>
    </div>
  );
}

export default App;
